    F31_Performance: URIRef
    """This class comprises activities where an instance of F1 Work is presented or communicated directly or indirectly to an audience, such as a theatrical play, a musical work or a choreographic work. Performances can be identified at various levels of granularity, but an instance of F31 Performance is always associated with a single identified instance of F1 Work. An instance of F31 Performance may consist of other instances of F31 Performance as parts, such as a piano concerto that has multiple movements. In addition, a complete run of equivalent performances of the same work can also be seen as an instance of F31 Performance, with the individual performances as parts. Activities that include performing multiple individual works, e.g., that are put together as a program for a show or concert, but where the activity as a whole is not associated with an instance of F1 Work, should be represented as instances of E7 Activity consisting of individual instances of F31 Performances as parts (the property P9 consists of (forms part of) expresses the relationship). Instances of F31 Performance may be created according to specific staging directions, be based on specific known instances of F2 Expression (such as translations), or be influenced by or include elements that relate to different works other than the single work the performance is dominated by. This can be documented using the properties P16 used specific object (was used for) or P15 was influenced by (influenced) ."""
