    """This property associates one instance of F3 Manifestation with another instance of F3 Manifestation that exemplifies the same instance of F2 Expression, when the two instances of F3 Manifestation can be used as alternatives for each other in particular use cases. This property is transitive and symmetric. It is irreflexive. The alternative manifestations may be in the same physical form, for example, simultaneous publications in different markets. More frequently, the alternative relationship is established when the alternative manifestations are in different physical forms, designed to enable use of the same content with different playback equipment (such as a DVD and Blu-ray disc version of the same videorecording)."""
    R79_has_representative_expression_attribute: URIRef
    """This property associates an instance of F1 Work with an instance of E55 Type that describes a category of attribute that is considered essential in characterizing instances of F1 Work. The types of interest will vary depending on the kind of work. The value of the attribute is considered representative of the instance of F1 Work. It is normally inferred from the values attributed to instances of F2 Expression that realize the work and that are considered canonical or best representative of the work. The values may also be assigned from characteristics abstracted from a more or less nebulous network of similar expressions. There is no requirement to precisely identify one or more expressions which serve as sources for the values of the types serving as representative expression attributes; however, if this is known, an instance of F2 Expression considered representative of an F1 Work may be related to the instance of F1 Work using the R73 takes representative attribute from (bears representative attribute for) property."""
    R79i_is_representative_expression_attribute_of: URIRef
    R7_exemplifies: URIRef
    """This property associates an instance of F3 Manifestation with an instance of F5 Item that is one of its exemplars or its only exemplar. Instances of F5 Item correspond to the kinds of physical unit(s) specified in the manifestation, regardless of possible later changes. Even though an item may exhibit defects with respect to the intended manifestation, it is still regarded to carry the manifestation, as long as it is produced or made accessible as a functional item by its creators."""
    R7i_is_exemplified_by: URIRef
    R80_performed: URIRef
    """This property associates an instance of F31 Performance with an instance of F1 Work. The property is used to express the association between an instance of F31 Performance and the instance of F1 Work it conveys."""
    R80i_is_performed_in: URIRef
    R81_recorded: URIRef
    """This property associates an instance of F28 Expression Creation with an instance of F31 Performance that it records. This property allows for the documentation of the association that exists between the outcome of an instance of F28 Expression Creation such as a performance recording, and the instance of F31 Performance that it is a recording of. For documenting performances that are more integral and planned parts of an expression creation (such as the recording of a performance solely done for the purpose of audio or video productions), the use of the property P9 consist of (forms part of) is more specific (and appropriate)."""
    R81i_is_recorded_in: URIRef
    R8_combines: URIRef
    """This property associates an instance of F12 Nomen with another instance of F12 Nomen where the string of the domain instance of F12 Nomen includes the complete symbolic content of the string of the range instance of F12 Nomen. This property is not transitive. It is asymmetric and irreflexive."""
    R8i_is_combined_to_form: URIRef
